function handleExternals(externalModules = [/*jsZipExternals, devextremeExternals*/]) {
    const externals = {};
    for (const ext of externalModules)
        Object.assign(externals, ext);
    return (context, request, callback) => {
        if (externals[request])
            return callback(null, externals[request]);
        callback();
    };
}

module.exports = {
    jsZipExternals,
    devextremeExternals,
    handleExternals,
};
